window.bookSummaryJSON = "<p><b>[Last Time in Multiverse Z!] A Shade Dragon Rogue and his battle partner wife slayed a demonic kill squad on their way to face an Unbeatable Demon Princess!</b></p> <p>The Beautiful Hell Plane is cruel and horrifying while filled with rich treasures and great challenges. Many desperate adventurers are slaughtered here to feed the powers of the demons. And to raise the infamy of Lady Cara Necro, the most wicked Greater Realm Goddess.</p> <p>Joey ends up in the multidimensional home of Lady Cara Necro after an apocalypse where the multiverse integrates whole universes and initiates countless humans to its game-like realms of limitless magic. Unlike most people who submit to Lady Cara Necro, Joey plans to ruin her evil plans.</p> <p>And slap the witch out of her!</p> <p>But first, Joey, his wife, and their new friends need to take down six Demon Rulers and a Devil Lord and make Beautiful Hell their own playground.</p> <p>Follow Joey in the seventh installment of his story as he uses his shadow, necromancy, dragon magic, and chaos cultivation to hunt down demons. He'll have help from his battle partner, Maylolee Eclipse, while she uses warfighting, charm, titanic strength, and system divinity.</p> <p>Listen now to enjoy an Apocalypse Isekai with a strong Progression LitRPG, a Cultivation System, and a happy marriage between two battle freaks. See them climb to the top of a multiverse system with their friends and go further beyond!</p> <p>[Welcome back to Multiverse Z!]</p> <p>[Now let's continue the show!]</p>"; 
